INSERT INTO `tb_ferramenta` (`cd_ferramenta`,`nm_ferramenta`,`nm_url_imagem`,`nm_funcao_javascript`,`ds_ferramenta`,`vl_custo`,`ic_projeto`,`nm_id_ferramenta`,`nm_url_ferramenta`,`ds_ajuda`) VALUES 
 (1,'Quantificação de Tomadas','imagens/FEI_01.png',NULL,'Com base em um cômodo especificado e em suas dimensões de largura e comprimento, calcula o número de tomadas, a potência elétrica por tomada  e a potência elétrica geral para as tomadas de uso geral.',NULL,0,'btn_fei1','FEI/Quantificacao de Tomadas.php','Com base em um cômodo especificado e em suas dimensões de largura e comprimento, calcula o número de tomadas, a potência elétrica por tomada  e a potência elétrica geral para as tomadas de uso geral.'),
 (2,'Disjuntor e Fiação','imagens/FEI_02.png',NULL,'Auxilia na escolha de disjuntor e da espessura mais apropriada para um circuito a partir de corrente, potência e tensão elétrica.',NULL,0,'btn_fei2','FEI/Disjuntor e Fiacao.php','Auxilia na escolha de disjuntor e da espessura mais apropriada para um circuito a partir de corrente, potência e tensão elétrica.'),
 (3,'Potência de Iluminação','imagens/FEI_03.png',NULL,'Com base na largura e no comprimento de um cômodo especificado, realiza o cálculo referente a potência mínima necessária para iluminar adequadamente o cômodo, apresentando o resultado em Watts.',NULL,0,'btn_fei3','FEI/Potencia de Iluminacao.php','Com base na largura e no comprimento de um cômodo especificado, realiza o cálculo referente a potência mínima necessária para iluminar adequadamente o cômodo, apresentando o resultado em Watts.'),
 (4,'Conversor de Grandezas','imagens/FEI_04.png',NULL,'Realiza a conversão das principais grandezas utilizadas nos cálculos de elétrica. Dentre elas carga, condutância, corrente, indutância, potência e resistência elétrica.',NULL,0,'btn_fei4','FEI/Conversor de Grandezas.php','Realiza a conversão das principais grandezas utilizadas nos cálculos de elétrica. Dentre elas carga, condutância, corrente, indutância, potência e resistência elétrica.'),
 (5,'Iluminação Geral','imagens/FEI_05.png',NULL,'Realiza o cálculo das principais propriedades de um ambiente, incluindo altura útil, coeficiente de utilização, fator de depreciação, fluxo luminoso e índice local. Apresenta também o número de pontos de luz e a potência adequada para a iluminação do ambiente apresentado.',NULL,0,'btn_fei5','FEI/Iluminacao Geral.php','Realiza o cálculo das principais propriedades de um ambiente, incluindo altura útil, coeficiente de utilização, fator de depreciação, fluxo luminoso e índice local. Apresenta também o número de pontos de luz e a potência adequada para a iluminação do ambiente apresentado.'),
 (6,'Área e Perímetro','imagens/FEI_06.png',NULL,'Realiza os cálculos referentes a área, medida de uma superfície de um ambiente, e perímetro, a soma das medida dos lados de um cômodo. Permite a seleção do cômodo e apresenta o resultado em metros  com base na largura e comprimento inseridos.',NULL,0,'btn_fei6','FEI/Area e Perimetro.php','Inserindo os valores de Largura (m) e Comprimento (m), é possível selecionar e calcular os resultados de Área (m²) ou Perímetro(m).'),
 (7,'Impedância Elétrica','imagens/FEI_07.png',NULL,'Calcula a medida da capacidade de um circuito resistir ao fluxo de determinada corrente elétrica, com base na resistência, capacitância e frequência da corrente.',NULL,0,'btn_fei7','FEI/Impedancia Eletrica.php','Calcula a medida da capacidade de um circuito resistir ao fluxo de determinada corrente elétrica, com base na resistência, capacitância e frequência da corrente.'),
 (8,'Condutância Elétrica','imagens/FEI_08.png',NULL,'Com base na tensão e na intensidade de uma corrente elétrica, permite o cálculo da propriedade que facilita a condutividade da corrente por meio de um corpo.',NULL,0,'btn_fei8','FEI/Condutancia Eletrica.php','Com base na tensão e na intensidade de uma corrente elétrica, permite o cálculo da propriedade que facilita a condutividade da corrente por meio de um corpo.'),
 (9,'Capacitância Elétrica','imagens/FEI_09.png',NULL,'Calcula o armazenamento de energia de suportado por um capacitor. Com base nos dados de corrente, potência e quantidade de energia da carga elétrica de 1 segundo por um ampère.',NULL,0,'btn_fei9','FEI/Capacitancia Eletrica.php','Calcula o armazenamento de energia de suportado por um capacitor. Com base nos dados de corrente, potência e quantidade de energia da carga elétrica de 1 segundo por um ampère.'),
 (10,'Potência Geral','imagens/FEI_10.png',NULL,'Calcula a Potência Ativa, Potência Reativa e consequentemente a Potência aparente de uma instalação monofásica, bifásica ou trifásica, com base na corrente elétrica, tensão máxima fornecida e fator potência inseridos pelo usuário.',NULL,0,'btn_fei10','FEI/Potencia Geral.php','Calcula a Potência Ativa, Potência Reativa e consequentemente a Potência aparente de uma instalação monofásica, bifásica ou trifásica, com base na corrente elétrica, tensão máxima fornecida e fator potência inseridos pelo usuário.'),
 (11,'Rendimento do Motor','imagens/FEI_11.png',NULL,'Realiza o cálculo do rendimento de um motor em um circuito elétrico com base nos valores de energia dissipada e energia útil aplicada neste. ',NULL,0,'btn_fei11','FEI/Rendimento de Motor.php','Realiza o cálculo do rendimento de um motor em um circuito elétrico com base nos valores de energia dissipada e energia útil aplicada neste.'),
 (12,'Indutância Elétrica','imagens/FEI_12.png',NULL,'Com base na corrente elétrica e no número de espirais que compõem a bobina de resistência da corrente, realiza o cálculo para determinar a corrente absorvida no circuito e dimensionar corretamente a proteção de condutores acima de 20m, apresentando o resultado em Henry.',NULL,0,'btn_fei12','FEI/Indutancia Eletrica.php','Com base na corrente elétrica e no número de espirais que compõem a bobina de resistência da corrente, realiza o cálculo para determinar a corrente absorvida no circuito e dimensionar corretamente a proteção de condutores acima de 20m, apresentando o resultado em Henry.'),
 (13,'Calculadora','imagens/FEI_13.png',NULL,'Realiza diversos cálculos matemáricos básicos, incluindo soma, subtração, multiplicação e divisão.',NULL,0,'btn_fei13','FEI/EletronTech Calc.php',NULL),
 (14,'Diagramação','imagens/FEI_14.png',NULL,'Ferramenta que possibilita a elaboração de plantas elétricas residenciais de baixa tensão e auxilia na realização de cálculos e no registro de materiais utilizados no desenvolvimento do projeto.',NULL,1,'btn_fei14','FEI/projeto/index.php',NULL);
INSERT INTO `tb_pacote` (`cd_pacote`,`nm_pacote`,`im_pacote`,`ds_pacote`,`vl_custo`,`ic_custom`,`cd_usuario`,`im_fundo`,`nm_cor`) VALUES 
 (1,'Eletron Tech Tester Pack','imagens/pacotes/tester.png','Esse é seu pacote inicial. Ele contem as principais ferramentas do sistema, e está disponível para você gratuitamente pelos primeiros sete dias de utilização.',NULL,0,NULL,'imagens/shop/tester.jpg','green'),
 (2,'Eletron Tech Basic Pack','imagens/pacotes/basic.png','Neste pacote você encontra as ferramentas essenciais para a realização de cálculos de elétrica.',NULL,0,NULL,'imagens/shop/basic.jpg','#600372'),
 (3,'Eletron Tech Light Pack','imagens/pacotes/light.png','O pacote Light oferece a você ferramentas voltadas para cálculos de elétricas com foco em luminotécnicos. ',NULL,0,NULL,'imagens/shop/light.jpg','lightgray'),
 (4,'Eletron Tech Advanced Pack','imagens/pacotes/advanced.png','No pacote Advanced você encontra as principais ferramentas para cálculos de corrente elétrica e fiação.',NULL,0,NULL,'imagens/shop/advanced.jpg','red'),
 (5,'Eletron Tech Draw Pack','imagens/pacotes/draw.png','Para você que utiliza ferramentas de desenho, este é o pacote certo! Contendo as principais ferramentas de diagramação.',NULL,0,NULL,'imagens/shop/draw.jpg','blue'),
 (6,'Eletron Tech Measure Pack','imagens/pacotes/measure.png','Este pacote oferece a você as principais ferramentas de cálculo de dimensionamento, tanto de elétrica, quanto de estruturas.',NULL,0,NULL,'imagens/shop/measure.jpg','orange'),
 (7,'Eletron Tech Golden Pack','imagens/pacotes/golden.png','No pacote Golden você possui todas as ferramentas disponibilizadas pelo EletronTech. Desde cálculos específicos, até a diagramação mais elaborada.',NULL,0,NULL,'imagens/shop/golden.jpg','gold'),
